import React from "react";
import { Card, Avatar } from "antd";

const UserProfile = () => {
    return (
        <Card
            actions={[
                <div key="twit">
                    <br /> 트윗
                </div>,
                <div key="followings">
                    <br />
                    팔로잉
                </div>,
                <div key="followers">
                    <br />
                    팔로워
                </div>,
            ]}
        >
            <Card.Meta title="Zino" avatar={<Avatar>ZINO</Avatar>}></Card.Meta>
            <Button>로그아웃</Button>
        </Card>
    );
};

export default UserProfile;
